window.bookSummaryJSON = "<p><b>Fate. Destiny. The Gods.</b></p> <p>All of it felt set against me as I traveled back through time with nothing to guide me but my heart.</p> <p>I was soon to discover that it wasn't my heart that would betray me. It was the HellBeast's heart that thought… I had betrayed him.</p> <p>Being lost in time was hard enough. But being lost in time while being hunted for revenge was even worse, a revenge that was never mine to receive.</p> <p>So, as I tumbled through the ages, I learned an important lesson. Sometimes… Time doesn't heal all wounds, after all. No, it just made them deeper.</p> <p>For a HellBeast King has not forgotten.</p> <p>And soon, I was to discover the true meaning of a HellBeast's hate.</p>"; 
